import React from "react";
import "./levels.css";
import { deviceData } from "./pwr";



//Title Bar
const PageTitle = () => {
    return (
      <header id="page-title">
      
        <h3>CUM </h3>
      </header>
    );
  };

export const Devices = () => {
  return (
    <>
      <PageTitle />
      <div className="stock-container">
        {deviceData.map((data, key) => {
          return (
            <div key={key}>
              <Device
                key={key}
                company={data.company}
                ticker={data.ticker}
                stockPrice={data.stockPrice}
                timeElapsed={data.timeElapsed}
              />
            </div>
          );
        })}
      </div>
    </>
  );
};



const Device = ({ company, ticker, stockPrice, timeElapsed }) => {
  if (!company) return <div />;
  return (
    <table>
      <tbody>
        <tr>
          <td>
            <h5>{company}</h5>
          </td>
          <td>
            <h5>{ticker}</h5>
          </td>
          <td>
            <h4>{stockPrice}</h4>
          </td>
          <td>
            <p>{timeElapsed}</p>
          </td>
        </tr>
      </tbody>
    </table>
  );
};
